import React from 'react';
import "slick-carousel/slick/slick.css"; 
import Slider from "react-slick";
import "slick-carousel/slick/slick-theme.css";
import slide from "./slide.css";

function Multi() {

     let settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1,
        cssEase: "linear"
    }


  return (
     <Slider {...settings}>
            
            </Slider>
  )
}

export default Multi;
